import React, { useState } from "react";
import { createClient } from "@supabase/supabase-js";

// Initialize Supabase client

const supabaseUrl = 'https://oxtohyacoirawnqpbupj.supabase.co'
const supabaseKey = process.env.SUPABASE_KEY
const supabase = createClient(supabaseUrl, supabaseKey)

function Home() {
    const [uploadStatus, setUploadStatus] = useState("");

    // Handle file upload
    const handleFileUpload = async (event) => {
        const file = event.target.files[0];

        if (file) {
            setUploadStatus("Uploading...");
            try {
                const { data, error } = await supabase.storage
                    .from("pdf-uploads") // Replace with your bucket name
                    .upload(`uploads/${file.name}`, file, {
                        cacheControl: "3600",
                        upsert: false, // Prevent overwriting existing files
                    });

                if (error) {
                    setUploadStatus(`Upload failed: ${error.message}`);
                } else {
                    setUploadStatus("File uploaded successfully!");
                    console.log("Uploaded file:", data);
                }
            } catch (error) {
                setUploadStatus(`Unexpected error: ${error.message}`);
            }
        } else {
            alert("Please select a file!");
        }
    };

    return (
        <div style={styles.container}>
            <h1 style={styles.title}>MedCo</h1>
            <div style={styles.uploadSection}>
                <label htmlFor="pdfUpload" style={styles.uploadLabel}>
                    Upload Your PDF
                </label>
                <input
                    type="file"
                    id="pdfUpload"
                    accept=".pdf"
                    onChange={handleFileUpload}
                    style={styles.uploadInput}
                />
            </div>
            {uploadStatus && <p style={styles.status}>{uploadStatus}</p>}
        </div>
    );
}

// Inline Styles
const styles = {
    container: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        backgroundColor: "#e0f7f7", // Background color matching your design
    },
    title: {
        fontSize: "2rem",
        color: "#008080", // Teal color for the title
        marginBottom: "20px",
    },
    uploadSection: {
        textAlign: "center",
    },
    uploadLabel: {
        display: "inline-block",
        padding: "10px 20px",
        backgroundColor: "#008080",
        color: "white",
        fontSize: "16px",
        borderRadius: "5px",
        cursor: "pointer",
    },
    uploadInput: {
        display: "none", // Hide the default file input
    },
    status: {
        marginTop: "20px",
        color: "#008080",
    },
};

export default Home;
